<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Document</title>
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
  <meta name="description" content="Description">
  <meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=1.0">
  <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/docsify-themeable@0/dist/css/theme-simple.css">
</head>
<body>
  <div id="app"></div>
  <script>
    window.$docsify = {
      name: 'Setsquare CMS',
      repo: '',
      loadSidebar: true,
      coverpage: true,
      maxLevel: 4,
      subMaxLevel: 3,
      themeColor: '#E20C1A',
      gtag: 'G-0ENTFN5SW9',
      formatUpdated: function (time) {
        return "Last updated on " + time;
      },
      plugins: [
        function(hook, vm) {
          hook.beforeEach(function(html) {
            return (
              html +
              '\n\n---\n\n' +
              '{docsify-updated}' 
            );
          });
        }
      ]
    }
  </script>
  <!-- Docsify v4 -->
  <script src="//cdn.jsdelivr.net/npm/docsify@4"></script>

  <!-- Temporary until new release incorporates gtag.js -->
  <script src="//cdn.jsdelivr.net/gh/sy-records/docsify-nightly@master/lib/plugins/gtag.min.js"></script>
  <!--<script src="//cdn.jsdelivr.net/npm/docsify/lib/plugins/gtag.min.js"></script>-->
</body>
</html>
